<?php date_default_timezone_set("America/Sao_Paulo"); error_reporting(0); session_start(); function envia($data,$apelido, $mensagem){ $arquivo = "chato/.vai-se-fude"; $fopen = fopen($arquivo, "r"); $fgets = fgets($fopen); fclose($fopen); $decode = json_decode($fgets,true); end($decode); if(key($decode) >= 11){ array_shift($decode); $new_key = 11; } else{ $new_key = key($decode); $new_key++; } $format = array($data,$apelido,$mensagem); $decode[$new_key] = $format; $encode = json_encode($decode); $abre = fopen($arquivo,"w"); fwrite($abre,$encode); fclose($abre); }function imprime(){ $arquivo = "chato/.vai-se-fude"; $fopen = fopen($arquivo,"r"); $fgets = fgets($fopen); fclose($fopen); $decode = json_decode($fgets, true); $html .= "<table class='table table-condensed'><font color='#90ee90'><b>--></b> </font><font color='darkgrey'>Conectado</font>"; foreach($decode as $valor){ $html .= "</tr><tr><td><font color='#7d7d7d'>".$valor[0]."</font>&ensp;<b><font color='".htmlentities($valor[1], ENT_COMPAT, 'UTF-8')."'>".htmlentities($valor[1], ENT_COMPAT, 'UTF-8')."</font></b>&emsp;".htmlentities($valor[2], ENT_COMPAT, 'UTF-8')."</td>"; } $html .= "</tr><tr><td></td></table>"; return($html); }if(isset($_POST["chat"]) && $_POST["chat"] != ""){ $apelido = $_POST['apelido']; $mensagem = $_POST["chat"]; envia(date("H:i:s"),$apelido,$mensagem);} if(isset($_GET["chat"]) && $_GET["chat"] != ""){echo imprime(); exit;}?>
