  <script defer>
    document.querySelector('#the_button').addEventListener('click',function(e){
      e.preventDefault();
      let theme = localStorage.getItem('tema');
      if (theme == 'p-dark-mode') {
        localStorage.setItem('tema','default');
      }else{
        localStorage.setItem('tema','p-dark-mode');
      }
      retrieve_theme();
    });
    function retrieve_theme(){
      let theme = localStorage.getItem('tema');
      if(theme != null){
        document.body.classList.remove('default', 'p-dark-mode'); document.body.classList.add(theme);
      }
    }
    window.addEventListener("storage",function(){
      retrieve_theme();
    },false);
    retrieve_theme();
  </script>
